import { StatusBar } from 'expo-status-bar';
import { Alert, Pressable, StyleSheet, Text, TouchableNativeFeedback, View } from 'react-native';
import Main from './src/components/main';

export default function App() {
  return (
    <View style={styles.container}>
      <TouchableNativeFeedback
      onPress={() => Alert.alert('Hola usuario')}
      >
      <Text style={styles.Text}>Hola Youtube</Text>
      <Main />
      </TouchableNativeFeedback>
      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  Text: {
    color: '#000'
  }
});
